import React from "react";
import ReactDOM from "react-dom/client";
import './index.css';

class Squares extends React.Component{
    render ()
    {
        return(
            <button className="square-button">{this.props.value}</button>
        )
    }
}
class Board extends React.Component{
    renderSquare(i)
    {
        return <Squares value={i} />;
    }
    render()
    {
        const playername = "Player : X";
        return(
            <div className="playerdef">{playername}</div>
        )
    }
}
